class TestAtomBlockchainInspector(TestCase):
    def setUp(self) -> None:
        self.atom_node_class = AtomscanNode

    def test_get_wallets_balance_node(self):
        addresses = ['cosmos1fm3tu2tgt57pcgst8g09frv6x2p6jy0p4h080x', 'cosmos18ld4633yswcyjdklej3att6aw93nhlf7ce4v8u']
        mocked_request_response = [
            {'balance': {'denom': 'uatom', 'amount': '1278750'}},
            {'balance': {'denom': 'uatom', 'amount': '418365546449'}}
        ]
        expected_result = [{'address': 'cosmos1fm3tu2tgt57pcgst8g09frv6x2p6jy0p4h080x', 'balance': Decimal('1.278750'),
                            'received': Decimal('1.278750'), 'sent': Decimal('0'), 'rewarded': Decimal('0')},
                           {'address': 'cosmos18ld4633yswcyjdklej3att6aw93nhlf7ce4v8u', 'balance':
                               Decimal('418365.546449'), 'received': Decimal('418365.546449'), 'sent': Decimal('0'),
                            'rewarded': Decimal('0')}]
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_BALANCE = api
        api.request = Mock(spec=atom)
        api.request.side_effect = mocked_request_response
        results = AtomBlockchainInspector.call_api_balances(addresses)
        assert results == expected_result

    def test_get_wallet_transactions_node(self):
        address = 'cosmos1p73zsvyzzs9cgv0n3zd6nsesctnlmfu205x8xd'
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_TRANSACTION = api
        api.request = Mock(spec=atom)
        api.request.side_effect = self.mocked_get_txs_response
        results = AtomBlockchainInspector.call_api_wallet_txs(address)
        for index, result in enumerate(results):
            assert vars(result) == vars(self.get_txs_expected_result[index])

    def test_get_wallet_transactions_multi_send(self):
        address = 'cosmos144fzpepuvdftv4u4r9kq8t35ap2crruv4u3udz'
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_TRANSACTION = api
        api.request = Mock(spec=atom)
        api.request.side_effect = self.mocked_get_txs_multi_response
        results = AtomBlockchainInspector.call_api_wallet_txs(address)
        for index, result in enumerate(results):
            assert vars(result) == vars(self.get_txs_multi_expected_result[index])


    def test_get_wallet_withdraw_node(self):
        address = 'cosmos1p73zsvyzzs9cgv0n3zd6nsesctnlmfu205x8xd'
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_TRANSACTION = api
        api.request = Mock(spec=atom)
        api.request.side_effect = self.mocked_get_wallet_withdraw
        results = AtomBlockchainInspector.get_wallet_withdraw_node(address)
        for index, result in enumerate(results):
            assert vars(result) == vars(self.get_wallet_withdraw_expected_result[index])

