class TestFigmentAtomBlockchainInspector(TestCase):
    def setUp(self) -> None:
        self.atom_node_class = FigmentNode

    def test_get_wallets_balance_node(self):
        addresses = ['cosmos1fm3tu2tgt57pcgst8g09frv6x2p6jy0p4h080x', 'cosmos18ld4633yswcyjdklej3att6aw93nhlf7ce4v8u']
        mocked_request_response = [{'balance': {'denom': 'uatom', 'amount': '1278750'}},
                                   {'balance': {'denom': 'uatom', 'amount': '214548554605'}}
        ]
        expected_result = [{'address': 'cosmos1fm3tu2tgt57pcgst8g09frv6x2p6jy0p4h080x', 'balance': Decimal('1.278750'), 'received': Decimal('1.278750'), 'sent': Decimal('0'), 'rewarded': Decimal('0')}, {'address': 'cosmos18ld4633yswcyjdklej3att6aw93nhlf7ce4v8u', 'balance': Decimal('214548.554605'), 'received': Decimal('214548.554605'), 'sent': Decimal('0'), 'rewarded': Decimal('0')}]
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_BALANCE = api
        api.request = Mock(spec=atom)
        api.request.side_effect = mocked_request_response
        results = AtomBlockchainInspector.call_api_balances(addresses)
        assert results == expected_result

    def test_get_wallet_transactions_node(self):
        address = 'cosmos1n95ayqlwcnz8w8skznrshdp8zr4r8vxmc3quj7'
        api = self.atom_node_class.get_api()
        AtomBlockchainInspector.PROVIDER_TRANSACTION = api
        api.request = Mock(spec=atom)
        api.request.side_effect = self.mocked_get_txs_response_figment
        results = AtomBlockchainInspector.call_api_wallet_txs(address)
        for index, result in enumerate(results):
            assert vars(result) == vars(self.get_txs_expected_result_figment[index])

    def test_get_wallet_transactions_generated_failed_tx_node(self):
        address = 'cosmos14ljzg5nf7unn8esf7002ldvkrcrgp9kestghps'
